# ATTRIBUTION-AI: llama-3.1-nemotron-ultra-253b-v1  2025-04-23  (suggestions)
_create_ssl-server() {
	_messageNormal '_create_ssl-server: '"$currentPrefix"_"$currentServer"

	local currentFileName_base="$currentPrefix"_"$currentServer"
	local currentDomainName="$currentServer"

	if [[ -e "$currentFileName_base".key ]] || [[ -e "$currentFileName_base".csr ]] || [[ -e "$currentFileName_base".crt ]]
	then
		_messagePlain_request 'request: to replace: rm -f '"$currentFileName_base".*
		_messagePlain_good 'exists: skip: _create_ssl-server: '"$currentPrefix"_"$currentServer"
		return 0
	fi


	openssl genrsa -out "$currentFileName_base".key 4096

	openssl req -new -key "$currentFileName_base".key -out "$currentFileName_base".csr -subj "/C=XX/ST=XX/L=XX/O=fellowship_adhoc_m335/CN=""$currentDomainName" -config <(printf "[req]\nreq_extensions = v3_req\n[ v3_req ]\nextendedKeyUsage=serverAuth\nsubjectAltName=IP:127.0.0.1,DNS:$currentDomainName")

	openssl x509 -req -in "$currentFileName_base".csr -signkey "$currentFileName_base".key -out "$currentFileName_base".crt -days 9125

	_messagePlain_good 'done: _create_ssl-server: '"$currentPrefix"_"$currentServer"
}

_create_ssl() {
	local currentServer=""

	# 'ultra' ... best REASONING , possibly also best INSTRUCT
	# ie. Llama 3.1 Nemotron Ultra 253b v1
	currentServer=ultra
	_create_ssl-server "$@"

	## DEPRECATED
	## 'task' ... best INSTRUCT ... ONLY if not same as 'ultra'
	#currentServer=task
	#_create_ssl-server "$@"

	# 'vision' ... best fast SUMMARY of screenshots, sensors, etc
	# ie. Mistral Small 3.1 24b
	currentServer=vision
	_create_ssl-server "$@"

	# 'augment' ... very fast automation
	# ie. Llama-augment
	currentServer=augment
	_create_ssl-server "$@"
}



